import React from "react";
import ContentItem from "./ContentItem";
import ContentHeader from "./ContentHeader";
import ContentImg from "./ContentImg";

const ContetntItems = (props) => {
  const { repos } = props;

  if (!repos || repos.length === 0) return <p>servser can't responce , sorry</p>;
  return (
    <div>
        {repos.map((data,i) => {
        return (

           <div key={data.id}>
             <ContentHeader partMovier="{data.name}" fullviewurl="{data.fullviewurl}" />
            <ContentItem
              urlMovie="{data.urlMovie}"
              urlImage="{data.urlImage}"
              rate="{data.rate}"
              imdb="{data.imdb}"
              name="{data.fullname}"
            />
            <ContentImg poster="{data.poster}" urlPoster="{data.urlPoster}" /> 
          </div> 
        ); 
      })} 
      {console.log(repos.data)}
    </div>
  );
};

export default ContetntItems;
